import Navbar from "./components/Navbar";
import React from "react";
import { BrowserRouter as Router, Switch, Routes, Route } from 'react-router-dom'
import './App.css'

function App() {
  return (
    <>
      <Router>
        <Navbar/>
        <Routes>
         <Route path = '/' exact />
        </Routes>
      </Router>

    </>
  );
}

export default App;
